import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六辛日癸巳时断</p><p>六辛日生时癸巳，贵气无伤官印强；</p><p>月气有通兼倚托，早年荣贵姓名香。</p><p>辛日癸巳时，官印扶身。</p><p>辛以丙为官，戊为印，癸为食神。</p><p>巳上丙戊健旺，癸合化火，赤白文章。</p><p>若有倚托、通月气者，显达；若月不通，运通，亦贵。</p><p>辛丑日癸巳时，凶，别父母发福。</p><p>春夏，吉。</p><p>秋冬，凶暴。</p><p>一云化贵、戒酒。</p><p>辛卯日癸巳时，春夏，身弱寿促。</p><p>秋，身强、劳力辛苦。</p><p>如月气火木，三、四品贵。</p><p>辛巳日癸巳时，化贵。</p><p>子午年，寅午戌月，贵，亥卯未，清贵。</p><p>申子辰，无义之人。</p><p>辛巳癸巳，两干不杂寅辰，透丙，俱主极贵。</p><p>丑酉三合，亦吉。</p><p>辛未日癸巳时，寅午戌月，高命。</p><p>巳酉丑，身旺平稳。</p><p>申子辰，白丁。</p><p>亥卯未，清贵。</p><p>辛酉日癸巳时，贵显，酒色重。</p><p>寅卯，财旺，吉。</p><p>丑，三合全，富贵。</p><p>辛亥日癸巳时，时日并冲，忧伤妻子。</p><p>春财旺。</p><p>夏，吉。</p><p>秋，平。</p><p>冬，凶暴。</p><p>酉午年月，木火运，风宪、都堂。</p><p>癸巳时逢辛日干，柱中独喜显财官；运行禄马无刑地，金榜题名步御銮。</p><p>辛日时临癸巳，春生财旺基。</p><p>丙丁午年最为奇，破克刑冲不利。</p><p>壬癸庚申无破，功名富贵为的。</p><p>妻贤子孝两相宜，刑破巳时不利。</p>",37),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","256卷 九·六辛日癸巳时断.html.vue"]]);export{f as default};
